import { Home } from "./pages/Home";
import{ BrowserRouter, Route} from 'react-router-dom'
import { NewRoom } from "./pages/NewRoom";

function App() {
  return (
   <BrowserRouter>
   <Route path='/' component={Home}/>
   <Route path='/rooms/new' component={NewRoom}/>

   </BrowserRouter>
  );
}

export default App;
